import React from 'react';
import { Link } from 'react-router-dom';
import './Nav.css';
const Nav = (props) => {
    return (
        <nav className="nav">
            <ul className="nav_ul">
                <li ><Link to="/" className="logo">Logo</Link></li>
                <li className="nav-lgsn"><Link to="/login">Login</Link></li>
                <li className="nav-lgsn"><Link to="/register">Signup</Link></li>
                <li className="nav-lgsn">Blogs</li>
            </ul>
        </nav>
    );
}

export default Nav;
